import React from "react";

const Contactus = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-4 col-md-4 col-6">
            <div className="card">
                </div>
        </div>

        <div className="col-lg-4 col-md-4 col-6"></div>
        <div className="col-lg-4 col-md-4 col-6"></div>
      </div>
    </div>
  );
};

export default Contactus;
